class Postform extends Component {
  constructor(props){
    super(props)
    this.state = {
      userId:  '',
      title : '',
      body: ''
    }
  }
  
  
  
  
  render() {
    return (
      <div>
        <form >
          <div>
            <label for="Username">Username:</label>
            <input type="text" id="name" name="name"/>
          </div>
          <div>
            <label for="Email">Email:</label>
            <input type="text" id="name" name="name"/>
          </div>
          <div>
            <label for="password">Password:</label>
            <input type="text" id="name" name="name"/>
          </div>
        </form>
      </div>
    )
  }
}

export default Postform
